[build]
command = "yarn next build"
publish = ".next"

  [build.environment]
  NEXT_PRIVATE_TARGET = "server"

[[plugins]]
package = "@netlify/plugin-nextjs"

[[redirects]]
from = "/_next/data/FwCWT6qJZ6zYJDgOoE1UU/index.json"
